@Chaz59841175 @mtracey The EUAA deal was never shelved.
Negotiations were ongoing for 6yrs, &amp; during that time Ukraine's gov made reforms &amp; passed laws to comply w/ the EUAA terms. (Including Yanukovych &amp; members of his party in the Rada.)
Yanukovych ran on platform saying he would get EUAA finalized.

